from typing import List

class Solution:
    def minSwaps(self, nums: List[int]) -> int:
        N = len(nums)
        one_count = nums.count(1)
        res = float('inf')
        zero_count = 0
        for i in range(N):
            if i == 0:
                chunk = nums[i:i+one_count]
                zero_count += chunk.count(0)
                j = one_count - 1
            else:
                if nums[i-1] == 0:
                    zero_count -= 1
                j = (j + 1) % N
                if nums[j] == 0:
                    zero_count += 1
            res = min(res, zero_count)
        return res

